import React, { Component } from 'react';
import './About.css';

class About extends Component {
    render() {
        return (
            <div id="about">
                <div className="row">
                    <div className="column">
                        <h1 className="name-container">D'Andre Campbell</h1>
                        <h3 className="title-container">Developer & Photographer</h3>                             
                    </div>
                    <div className="column">
                        <p className='about-text'>
                            Hey, my name is D’Andre. I’m a self taught, aspiring Front End Developer based out of New York. I choose this area of development because it allows me to combine my creative side with my love for coding. Currently, I’m working in the IT field as a Technician but I’ve always had an interest in the Development field. I have 4 years of programming in various different languages but currently React.js is my main focus.
                        </p>                        
                    </div>
                </div>
            </div>
        )
    }
}

export default About;
